using CodeCart;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Web;

namespace CodeCart
{
    public static class Product
    {
        public static List<ProductItem> ProductsList { get; } = new List<ProductItem>();
        public static List<ProductItem> Cart { get; } = new List<ProductItem>();

        static Product()
        {
            ProductsList.Add(new ProductItem(1, "Marionetta", 5.99, "Lei non dice le bugie", "data:image/jpeg;base64,"));
            ProductsList.Add(new ProductItem(2, "Libro", 10.99, "Un libro molto bello ma anonimo", "https://upload.wikimedia.org/wikipedia/commons/thumb/4/48/Libro_aperto%2C_uffizi.jpg/280px-Libro_aperto%2C_uffizi.jpg"));
            ProductsList.Add(new ProductItem(3, "Pallone da calcio", 10.99, "Gioca con i tuoi amichetti", "data:image/jpeg;base64,"));
            ProductsList.Add(new ProductItem(4, "Cereali", 3.50, "Davvero buoni nel latte", "data:image/jpeg;base64,"));
            ProductsList.Add(new ProductItem(5, "Orologio", 200, "Controlla l'ora, il tempo è denaro", "data:image/jpeg;base64,"));
            ProductsList.Add(new ProductItem(6, "Smartphone", 542.99, "Quando non vuoi più utilizzare il pallone", "data:image/jpeg;base64,"));
        }
    }

    public class ProductItem
    {
        public int Id { get; set; }
        public string Name { get; set; }
        public double Price { get; set; }
        public string Description { get; set; }
        public string ImageUrl { get; set; }

        public ProductItem(int id, string name, double price, string description, string imageurl)
        {
            Id = id;
            Name = name;
            Price = price;
            Description = description;
            ImageUrl = imageurl;
        }
    }
}